/**
Bootstrap css
**/
.react-pagination-js-bootstrap ul{

  padding: 0 0 0 0;
  margin: 0 0 0 0;
  list-style: none;
  display: inline-block;
  *display: inline;
  font-size: .875em;
  /* IE7 inline-block hack */

  *zoom: 1;
  margin-left: 0;
  margin-bottom: 0;
  -webkit-border-radius: 3px;
  -moz-border-radius: 3px;
  border-radius: 3px;
  -webkit-box-shadow: 0 1px 2px rgba(0, 0, 0, 0.05);
  -moz-box-shadow: 0 1px 2px rgba(0, 0, 0, 0.05);
  box-shadow: 0 1px 2px rgba(0, 0, 0, 0.05);
  font-family: inherit;
}
.react-pagination-js-bootstrap .page {
  float: left;
  padding: 0 14px;
  line-height: 34px;
  text-decoration: none;
  border: 1px solid #ddd;
  border-left-width: 0;
  cursor: pointer;
  color: #0088cc;
}
.react-pagination-js-bootstrap .is-active {
  float: left;
  padding: 0 14px;
  line-height: 34px;
  text-decoration: none;
  border: 1px solid #ddd;
  border-left-width: 0;
  color: #999999;
  background-color: #f5f5f5;
  cursor: default;
}
.react-pagination-js-bootstrap .pageElli {
  float: left;
  padding: 0 14px;
  line-height: 34px;
  text-decoration: none;
  border: 1px solid #ddd;
  border-left-width: 0;
  color: #999999;
  cursor: default;

}


.react-pagination-js-bootstrap .page:hover {
  background-color: #f5f5f5;
}

.react-pagination-js-bootstrap .page.active {
  color: #999999;
  cursor: default;
}


.react-pagination-js-bootstrap .page:first-child  {
  border-left-width: 1px;
  -webkit-border-radius: 3px 0 0 3px;
  -moz-border-radius: 3px 0 0 3px;
  border-radius: 3px 0 0 3px;

}
.react-pagination-js-bootstrap  .page:last-child  {
  -webkit-border-radius: 0 3px 3px 0;
  -moz-border-radius: 0 3px 3px 0;
  border-radius: 0 3px 3px 0;
}

